package it.pisa.jade.agents.peerAgent.ontologies;import jade.content.AgentAction;/** *  * @author Fabrizio Marozzo * */@SuppressWarnings("serial")public class Choose implements AgentAction {	private String ip;		private int port;		private String searchKey;		private String url;	public String getSearchKey() {		return searchKey;	}	public void setSearchKey(String searchKey) {		this.searchKey = searchKey;	}	public String getUrl() {		return url;	}	public void setUrl(String url) {		this.url = url;	}	public String getIp() {		return ip;	}	public void setIp(String ip) {		this.ip = ip;	}	public int getPort() {		return port;	}	public void setPort(int port) {		this.port = port;	}	}